import{_ as e,e as t}from"./app.53483c21.js";const a={},o=t('<h1 id="requirements" tabindex="-1"><a class="header-anchor" href="#requirements" aria-hidden="true">#</a> Requirements</h1><p>To use these starter dashboards, you need:</p><ul><li><p><strong>IBM Transaction Analysis Workbench for z/OS</strong></p><p>The starter dashboards use JSON Lines data from Transaction Analysis Workbench.</p><p>You must have configured Transaction Analysis Workbench to forward data to Logstash.</p></li><li><p><strong>Elastic Stack</strong></p><p>The starter dashboards and related Elastic Stack artifacts were developed and tested in Elastic Stack <strong>7.15.2</strong>. For compatibility with other versions of Elastic Stack, see the Elastic Stack documentation.</p></li></ul><h2 id="screen-resolution" tabindex="-1"><a class="header-anchor" href="#screen-resolution" aria-hidden="true">#</a> Screen resolution</h2><p>The dashboards were developed on a screen with a resolution of 1920 \u2715 1080 pixels.</p><p>At lower resolutions, some dashboards might exhibit rendering issues.</p><h2 id="what-you-need-to-know" tabindex="-1"><a class="header-anchor" href="#what-you-need-to-know" aria-hidden="true">#</a> What you need to know</h2><p>To install the starter dashboards, you need to know how to configure the Elastic Stack.</p><p>To forward data to the starter dashboards, you need to know how to configure Transaction Analysis Workbench.</p><p>To use the starter dashboards, you need to know how to use Kibana, and you need to understand the attributes shown in the dashboards.</p>',10);function s(r,n){return o}var d=e(a,[["render",s]]);export{d as default};
